s = s.substring(1, s.length() - 1);
}
s = StringUtils.replaceChars(s, " \t\n\r", "");
if (s.length() % 2 != 0) {
s = "0" + s;
}
try {
return Hex.decodeHex(s.toCharArray());
} catch (Exception e) {
throw (ParseException) new ParseException("Unable to parse the byte[] : " + e.getMessage());
}
